import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css"; // Your global CSS
import App from "./App.js"; // Import App.js (Ensure the file exists in `src` directory)
import { BrowserRouter } from "react-router-dom"; // React Router
import { Provider } from "react-redux"; // Redux Provider
import { store } from "./redux/store.js"; // Import Redux store (Ensure this file exists in `src/redux/`)
import "bootstrap/dist/css/bootstrap.min.css"; // Bootstrap CSS
import "bootstrap/dist/js/bootstrap.bundle.min.js"; // Bootstrap JS

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <Provider store={store}> {/* Provide Redux store to the app */}
    <BrowserRouter> {/* Enable routing */}
      <React.StrictMode> {/* Enable strict mode for debugging */}
        <App /> {/* Main App component */}
      </React.StrictMode>
    </BrowserRouter>
  </Provider>
);

